import React from 'react'
import classes from './Imput.module.css'

const Imput = (props) => {
    return (
        <div className={classes.imput}>
            <label htmlFor={props.imput.id}>{props.label}</label>
            <imput {...props.imput} />    
        </div>
    )
}

export default Imput
